import * as React from 'react';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import Divider from '@mui/material/Divider';
import ListItemText from '@mui/material/ListItemText';
import ListItemAvatar from '@mui/material/ListItemAvatar';
import Avatar from '@mui/material/Avatar';
import PropTypes from 'prop-types';
import DialogTitle from '@mui/material/DialogTitle';
import Dialog from '@mui/material/Dialog';
import PersonIcon from '@mui/icons-material/Person';
import AddIcon from '@mui/icons-material/Add';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import PhoneIcon from '@mui/icons-material/Phone';
import PhoneForwardedIcon from '@mui/icons-material/PhoneForwarded';
import EmailIcon from '@mui/icons-material/Email';
import WorkIcon from '@mui/icons-material/Work';
import { DataGrid } from '@mui/x-data-grid';

const columns = [
    { field: 'id', headerName: 'ID', width: 70 },
    { field: 'firstName', headerName: 'First name', width: 130 },
    { field: 'lastName', headerName: 'Last name', width: 130 },
    {
      field: 'age',
      headerName: 'Age',
      type: 'number',
      width: 90,
    },
    {
      field: 'fullName',
      headerName: 'Full name',
      description: 'This column has a value getter and is not sortable.',
      sortable: false,
      width: 160,
      valueGetter: (params) =>
        `${params.row.firstName || ''} ${params.row.lastName || ''}`,
    },
  ];

  const rows = [
    { id: 1, lastName: 'Snow', firstName: 'Jon', age: 35 },
    { id: 2, lastName: 'Lannister', firstName: 'Cersei', age: 42 },
    { id: 3, lastName: 'Lannister', firstName: 'Jaime', age: 45 },
    { id: 4, lastName: 'Stark', firstName: 'Arya', age: 16 },
    { id: 5, lastName: 'Targaryen', firstName: 'Daenerys', age: null },
    { id: 6, lastName: 'Melisandre', firstName: null, age: 150 },
    { id: 7, lastName: 'Clifford', firstName: 'Ferrara', age: 44 },
    { id: 8, lastName: 'Frances', firstName: 'Rossini', age: 36 },
    { id: 9, lastName: 'Roxie', firstName: 'Harvey', age: 65 },
  ];

export default function SimpleDialog(props) {
    const handleClose = () => {
        props.onClose();
    };

    return (
        <Dialog onClose={handleClose} open={props.open}>
            <DialogTitle>Informações Pessoais do Servidor</DialogTitle>
            <Box sx={{ flexGrow: 1, marginLeft: 2 }} style={{marginBottom:"16px"}}>
				<Grid container spacing={1}>
                    <Grid item xs={1} style={{display:"flex", alignItems:"center", justifyContent:"center"}}>
                        <Avatar alt={props.item.name} src={`https://www.inf.ufpr.br/hvehrenfried/Treinamento/Dados/photo/${props.item['photo file']}`} />
                    </Grid>
                    <Grid item xs={11} style={{display:"flex", alignItems:"center"}}>
                        <span>{props.item.name + " " + props.item.surname}</span>
                    </Grid>
                    <Grid item xs={1} style={{display:"flex", alignItems:"center", justifyContent:"center"}}>
                        <PhoneIcon fontSize='large' />
                    </Grid>
                    <Grid item xs={11} style={{display:"flex", alignItems:"center"}}>
                        <span>{props.item.phone}</span>
                    </Grid>
                    <Grid item xs={1} style={{display:"flex", alignItems:"center", justifyContent:"center"}}>
                        <PhoneForwardedIcon fontSize='large' />
                    </Grid>
                    <Grid item xs={11} style={{display:"flex", alignItems:"center"}}>
                        <span>{props.item.extension}</span>
                    </Grid>
                    <Grid item xs={1} style={{display:"flex", alignItems:"center", justifyContent:"center"}}>
                        <EmailIcon fontSize='large' />
                    </Grid>
                    <Grid item xs={11} style={{display:"flex", alignItems:"center"}}>
                        <span>{props.item.email}</span>
                    </Grid>
                    <Grid item xs={1} style={{display:"flex", alignItems:"center", justifyContent:"center"}}>
                        <WorkIcon fontSize='large' />
                    </Grid>
                    <Grid item xs={11} style={{display:"flex", alignItems:"center"}}>
                        <span>{props.item['job position']}</span>
                    </Grid>
				</Grid>
                <DataGrid
                    rows={rows}
                    columns={columns}
                    pageSize={5}
                    rowsPerPageOptions={[5]}
                />
			</Box>
        </Dialog>
    );
}
